CREATE TABLE `day_cload_tm` (
  `log_time` int(10) unsigned NOT NULL,
  `count_total` int(10) unsigned NOT NULL DEFAULT '0',
  `count_tm1_2_break` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '开始加载前离开人数，未看到logo',
