  `pie_tm1_2_normal1` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '看到片头分布数(1-3s)',
  `pie_tm1_2_normal2` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '看到片头分布数(3-6s)',
  `pie_tm1_2_slow` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '看到片头分布数(6-10s)',
  `pie_tm1_2_bad` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '看到片头分布数(>10s)',
  `count_total_new` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '新用户',
  `count_tm1_2_break_new` int(10) unsigned NOT NULL DEFAULT '0',
  `count_tm2_3_break_new` int(10) unsigned NOT NULL DEFAULT '0',
  `tm1_2_new` varchar(50) DEFAULT '',
  `tm2_3_new` varchar(50) DEFAULT '',
  `tm3_4_new` varchar(50) DEFAULT '',
  `pie_tm3_4_new` varchar(1000) DEFAULT '',
  `pie_tm1_2_fast_new` int(10) unsigned NOT NULL DEFAULT '0',
  `pie_tm1_2_normal1_new` int(10) unsigned NOT NULL DEFAULT '0',
  `pie_tm1_2_normal2_new` int(10) unsigned NOT NULL DEFAULT '0',
  `pie_tm1_2_slow_new` int(10) unsigned NOT NULL DEFAULT '0',
  `pie_tm1_2_bad_new` int(10) unsigned NOT NULL DEFAULT '0',
  `noflash_browser` varchar(1000) DEFAULT '',
  `nocookie_browser` varchar(1000) DEFAULT '',
  PRIMARY KEY (`log_time`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

